import React from "react";
import "./Home.css";
import Footer from "../../components/Footer/Footer.js"; 

const Home = () => {
  return (
    <div className="home">
      <main className="intro">
        <h1>Argyll Community Counselling Service</h1>
        <p>will soon be offering donation-based counselling across Mid-Argyll and Kintyre</p>
        <ul>
          <li>In person</li>
          <li>By telephone</li>
          <li>Online</li>
        </ul>
        <p>We have a dedicated team of counsellors with a wide range of experience and approaches. Referrals will be accepted directly from members of the community. For further information, please email admin@argyllcommunitycounselling.org.uk</p>
      </main>
    </div>
  );
};

export default Home;
